		function hideAllHeads() {
		    for (let i = 1; i <= total; i++) {
		        root["head" + i].visible = false;
		    }
		}
		// Function to show head by index
		function showHead(index) {
		    hideAllHeads();
		    root["head" + index].visible = true;
		}
		// Body
		function hideAllBodies() {
		    for (let i = 1; i <= total; i++) {
		        root["body" + i].visible = false;
		    }
		}
